import classes from "./Book.module.css";
import React from "react";
import Button from "./Button";

const Book = (props) => {
  return (
    <div className={classes.book}>
      <img
        src={
          props.image
            ? `https://covers.openlibrary.org/b/id/${props.image}-M.jpg?default=false`
            : "https://blog.springshare.com/wp-content/uploads/2010/02/nc-md.gif"
        }
        alt="no img found"
      ></img>{" "}
      <h4>{props.book.title}</h4>
      <h5>{props.book.author}</h5>
      <Button>Add to reding list</Button>
      <Button>Add to readed</Button>
    </div>
  );
};

export default Book;
